d:      .zero 16384
T1:     .zero 16384
T2:     .zero 16384
alpha: 	.word 1
beta:   .word 1
N:      .word 64

.text
        la  s1, a
        la  s2, b
        la  s3, c
        la  s4, d
        la  s5, T1
        la  s6, T2
        lw  s7, alpha
        lw  s8, beta
        lw  s9, N

        # Preliminary part: ... #

        # for(i=0,...,...){ #
        addi t0, zero, 4
        mul a3, s9, t0   # a3 -> 4*N 
        add  t1, zero, zero
        
        add a0, zero, s2 #Follows B
        add a1, zero, s6 #Follows T2
iloop:
        # for(j=0,...,...){ #Go column first
        add t2, zero, zero  #Tracks j
jloop:        
        lw t4, 0(a0) #Get value from B
        sw t4, 0(a1) #Save it to T2
        
        # for(...,...,j++)
        addi t2, t2, 1
        add a0,a0,t0 #go to next B column
        
        add t3,zero,s9
        mul t3,t3,t0 #go to next T2 row
        add a1,a1,t3
        
        # for(...,j<size,...) #Check if we have finished transposing a row
        blt t2, s9, jloop
        
        #if so make both go to beggining
        add a0, zero, s2
        add a1, zero, s6
        
        #update i
        addi t1,t1,1
                
        #Use t2 as aux, will reset to zero shortly anyway
        #B goes to right row
        add t2,zero,a3 #t2 -> 4*N
        mul t2,t2,t1   #t2 -> 4*N*i
        add a0,a0,t2   #B row = i
        
        #T2 goes to right column
        add t2,zero,t0 #t2 -> 4
        mul t2,t2,t1   #t2 -> 4*i
        add a1,a1,t2   #C column = i
        
        # for(...,i<size,...); Check if operation is done
        blt t1, s9, iloop
        
        # First part: T1 = A*B #

        # Initialization of auxiliaries:
        addi t0, zero, 4 #
        mul a3, s9, t0   # a3 -> 4*N
        add a0, zero, s1 # a0 -> *A
        add a1, zero, s6 # a1 -> *T2, we now use T2
        add t0, zero, a1 # t0 -> *auxT2 = T2
        add a2, zero, s5 # a2 -> *T1

        # for(i=0,...,...){ 
        add t1, zero, zero
f1loop1:
        # for(j=0,...,...){
        add t2, zero, zero
f1loop2:
        # for(k=0,...,...){
        add t3, zero, zero
        # aux1 = 0
        add t4, zero, zero
f1loop3:
        # ... += A[i][k] * ...
        lw t5, 0(a0)
        # ... += ... * T2[j][k]
        lw t6, 0(t0)
        # ... += A[i][k] * T2[j][k]
        mul t5, t5, t6 
        # aux1 += A[i][k] * T2[j][k]
        add t4, t4, t5
        # A++
        addi a0, a0, 4
        # auxB += N*4 (moves to the next column of T2)
        addi t0, t0, 4 #Equivalent to next row of B
        # for(...,...,k++)
        addi t3, t3, 1 
        # for(...,k<N,...)
        blt t3, s9, f1loop3
        # }
        # T1[i][j] = aux1;
        sw t4, 0(a2)
        # T1++
        addi a2, a2, 4
        # A -= N*4 (rewind to the first element of the row)
        sub a0, a0, a3
        # T2 next row
        add a1, a1, a3 #Equivalent to next B column
        # auxT2 = T2
        add  t0, zero, a1
        # for(...,...,j++)
        addi t2, t2, 1
        # for(...,j<N,...)
        blt t2, s9, f1loop2
        # }
        # A += N*4 (moves to the next row)
        add a0, a0, a3
        # T2 -> Reset
        add a1, zero, s6 #Reset T2 to beginning
        # auxT2 = T2
        add t0, zero, a1
        # for(...,...,i++)
        addi t1, t1, 1
        # for(...,i<N,...)
        blt t1, s9, f1loop1
        # }


        # Second part: D = alpha*T1 + beta*C #

        # Initialization of auxiliaries:
        addi t0, zero, 4 #
        mul a3, s9, t0   # a3 -> 4*N
        add a0, zero, s3 # a0 -> *C
        add a1, zero, s4 # a1 -> *D
        add a2, zero, s5 # a2 -> *T1

        # for(i=0,...,...){ #Order is IJ, as commented in program3
        add t1, zero, zero
f2loop1:  
        # for(j=0,...,...){
        add t0, zero, zero 
f2loop2:
        # ... = ... + ...*C[i][j]
        lw t2, 0(a0)
        # ... = ...*T1[i][j] + ...
        lw t3, 0(a2)
        # ... = alpha*T1[i][j] + ...
        mul t4, s7, t3
        # ... = ... + beta*C[i][j]
        mul t5, s8, t2
        # aux1 = alpha*T1[i][j] + beta*C[i][j]
        add t5, t5, t4
        # D[i][j] = aux1;
        sw t5, 0(a1)
        # C += N*4 (moves to the next column)
        addi a0, a0, 4
        # D += N*4 (moves to the next column)
        addi a1, a1, 4
        # T1 += N*4 (moves to the next column)
        addi a2, a2, 4
        # for(...,...,j++)   
        addi t0, t0, 1
        # for(...,j<size,...) 
        blt t0, s9, f2loop2
        # }
        # C -= N*N*4 (rewind to the first element of the matrix) 
        add a0, zero, s3
        # D -= N*N*4 (rewind to the first element of the matrix) 
        add a1, zero, s4
        # T1 -= N*N*4 (rewind to the first element of the matrix) 
        add a2, zero, s5
        # for(...,...,i++) 
        addi t1, t1, 1
        # aux2 = i*4, and use t0 as aux
        add t0, zero, a3
        mul t0, t0, t1
        # C += aux2
        add a0, t0, a0
        # D += aux2
        add a1, t0, a1
        # T1 += aux2
        add a2, t0, a2  
        # for(...,i<N,...)
        blt t1, s9, f2loop1
        # }


        # return
        li a7, 10
        ecall